import s from './Dialogs.module.css'
import Messages from "./Messages/Messages";
import Friends from "./Friends/Friends";

const Dialogs = () => {
    return (
        <div className={s.dialog}>
            <Friends />
            <Messages />
        </div>
    );
};

export default Dialogs;
